import c from './AllPosts.module.css';
import Post from './post/Post';
import React from 'react';

const AllPosts = (props) => {

    let allPostsData = [
        { id: 1, username: "Pavel", title: "Заголовок 1", text: "Текст", likes: 12, dislikes: 3 },
        { id: 1, username: "Petr", title: "Заголовок 2", text: "Текст", likes: 16, dislikes: 5 },
        { id: 1, username: "Dima", title: "Заголовок 3", text: "Текст", likes: 21, dislikes: 8 },
        { id: 1, username: "Anton", title: "Заголовок 4", text: "Текст", likes: 16, dislikes: 2 },
    ]

    let allPostsElements = allPostsData.map(
        ap => <Post username={ap.username} title={ap.title} text={ap.text} likes={ap.likes} dislikes={ap.dislikes} />
    );

    return (
        <div className={c.AllPosts}>
            {allPostsElements}
        </div>
    );
}

export default AllPosts;
